Import the specified test modules and run their tests as a suite.

Test modules are specified as an array of strings and can include local files
or URLs.

File matching and excluding support glob syntax - arguments recognized as
globs will be expanded using `glob()` from the `fs` module.

Example:

      runTestModules({ include: ["**\/*_test.ts", "**\/test.ts"] });

Any matched directory `<dir>` will expand to:
  <dir>/**\/?(*_)test.{js,ts}

So the above example is captured naturally by:

      runTestModules({ include: ["."] });

Which is the default used for:

      runTestModules();

Attempts to grant a set of permissions, resolving with the descriptors of
the permissions that are granted.

     const perms = await grant({ name: "net" }, { name: "read" });
     if (perms && perms.length === 2) {
       // do something cool that connects to the net and reads files
     } else {
       // notify user of missing permissions
     }

If one of the permissions requires a prompt, the function will attempt to
prompt for it.  The function resolves with all of the granted permissions.

Attempts to grant a set of permissions, resolving with the descriptors of
the permissions that are granted.

     const perms = await grant([{ name: "net" }, { name: "read" }]);
     if (perms && perms.length === 2) {
       // do something cool that connects to the net and reads files
     } else {
       // notify user of missing permissions
     }

If one of the permissions requires a prompt, the function will attempt to
prompt for it.  The function resolves with all of the granted permissions.

Determines whether an object has a property with the specified name.
Avoid calling prototype builtin `hasOwnProperty` for two reasons:

1. `hasOwnProperty` is defined on the object as something else:

     const options = {
       ending: 'utf8',
       hasOwnProperty: 'foo'
     };
     options.hasOwnProperty('ending') // throws a TypeError

2. The object doesn't inherit from `Object.prototype`:

      const options = Object.create(null);
      options.ending = 'utf8';
      options.hasOwnProperty('ending'); // throws a TypeError

Creates a Promise with the `reject` and `resolve` functions
placed as methods on the promise object itself. It allows you to do:

    const p = deferred<number>();
    // ...
    p.resolve(42);

